import React from "react";
import "./EditPlus.css";

function EditPlus(props) {
  const { editPlus, className } = props;

  return (
    <div className={`edit-plus ${className || ""}`}>
      <img className="edit-plus-1" src={editPlus} />
    </div>
  );
}

export default EditPlus;
